import React, { Component } from 'react';
import './App.css';
import Login from './Login.js';

class App extends Component {
  render() {
    return (
      <div className="App" style={{backgroundColor : "LightBlue"}}>
      <Login/>
      </div>
    );
  }
}

export default App;
